import React, { useState, useEffect } from 'react';

function ViewMyPackages() {
  const [packages, setPackages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    console.log("Fetching packages...");

    fetch('http://localhost:8081/package/get-package')
      .then((response) => {
        console.log("Response status:", response.status);
        if (!response.ok) {
          throw new Error('Failed to fetch packages');
        }
        return response.json();  // Asigură-te că răspunsul este JSON
      })
      .then((data) => {
        console.log("Data received:", data);
        setPackages(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>Error loading packages: {error.message}</p>;
  }

  if (packages.length === 0) {
    return <p>No packages available.</p>;
  }

  return (
    <div>
      <h2>My Packages</h2>
      <table style={styles.table}>
        <thead>
          <tr>
            <th>Package ID</th>
            <th>Courier Name</th>
            <th>Created On</th>
            <th>Delivery Address</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {packages.map((pkg) => (
            <tr key={pkg.id}>
              <td>{pkg.id}</td>
              <td>{pkg.courier ? pkg.courier.name : 'N/A'}</td>
              <td>{pkg.createdOn}</td>
              <td>{pkg.deliveryAddress || 'N/A'}</td>
              <td>{pkg.status || 'N/A'}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

// Stiluri pentru tabelă
const styles = {
  table: {
    width: '100%',
    borderCollapse: 'collapse',
    marginTop: '20px',
  },
  th: {
    backgroundColor: '#f4f4f4',
    padding: '10px',
    textAlign: 'left',
    border: '1px solid #ddd',
  },
  td: {
    padding: '10px',
    textAlign: 'left',
    border: '1px solid #ddd',
  },
  trEven: {
    backgroundColor: '#f9f9f9',
  },
  trOdd: {
    backgroundColor: '#fff',
  }
};

export default ViewMyPackages;
